      <ul>
        <li>Stuff 1</li>
        <li>Stuff 2</li>
        <li>Stuff 3</li>
        <li>Stuff 4</li>
      </ul>
    </div>
  );
}

function NavBar() {
  <div id="nav-bar">
    <header>
      <nav>
        <ul>
          <li>Home</li>
          <li>About</li>
          <li>Catalog</li>
        </ul>
